import React from 'react';
import classes from './Projects.module.css';
import Project from './Project/Project';
import weatherPic from '../../assets/WeatherFinder.png';

const projects = () => {
    let flightDesc = "CSS | JS | React | Redux | Express | Node.js";
    let weatherDesc = "CSS | JavaScript";
    let memoryDesc = "CSS | JavaScript | React"

    return (
        <div className={classes.Projects}>
            <h1>PROJECTS PORTFOLIO</h1>
            <div className={classes.ProjectsContainer}>
                <Project />
                <Project name="Flight Booker" desc={flightDesc} pic={weatherPic}/>
                <Project name="Weather Finder" desc={weatherDesc} pic={weatherPic}/>
                <Project name="Memory Game" desc={memoryDesc} pic={weatherPic}/>
            </div>
        </div>
    )
}

export default projects;
